import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className="navBarContainer">
            <h1 className="navTitle"> AgoraBoard </h1>
                <ul>
                    <li><Link to="/">Home</Link></li>
                    <li><Link to="/about">About</Link></li>
                </ul>
        </nav>
    )
}

export default Navbar;
